resources.string:
Nemáte žiadne kontakty, ktoré by sa dali zobraziť.

Ak chcete pridať kontakty, dotknite sa tlačidla Menu a následne sa dotknite jednej z nasledujúcich možností:

ak chcete nastaviť účet s kontaktmi, ktoré môžete synchronizovať s telefónom, dotknite sa možnosti Účty;

ak chcete vytvoriť úplne nový kontakt, dotknite sa možnosti Nový kontakt;

ak chcete importovať kontakty z karty %s alebo karty SD, dotknite sa možnosti Import a export.

Nemáte žiadne kontakty, ktoré by bolo možné zobraziť.

Ak chcete pridať kontakty, dotknite sa tlačidla Menu a následne sa dotknite jednej z nasledujúcich možností:

ak chcete nastaviť účet s kontaktmi, ktoré môžete synchronizovať s telefónom, dotknite sa možnosti Účty;

ak chcete vytvoriť úplne nový kontakt, dotknite sa možnosti Nový kontakt;

ak chcete importovať kontakty z karty SIM alebo karty SD, dotknite sa možnosti Import a export.

Nemáte žiadne kontakty, ktoré by bolo možné zobraziť. (Ak ste práve pridali účet, môže synchronizácia kontaktov trvať niekoľko minút.)

Ak chcete pridať kontakty, dotknite sa tlačidla Menu a následne sa dotknite jednej z nasledujúcich položiek:

Účty, ak chcete pridať alebo nakonfigurovať účet a kontakty v ňom synchronizovať s telefónom;

Možnosti zobrazenia, ak chcete zmeniť možnosti viditeľnosti kontaktov;

Nový kontakt, ak chcete vytvoriť úplne nový kontakt;

Import a export, ak chcete importovať kontakty zo svojej karty SD.
